using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UINavigationBarDelegate_Protocol/index.html#//apple_ref/occ/intf/UINavigationBarDelegate	/// <summary>	/// The UINavigationBarDelegate protocol defines optional methods that a UINavigationBar delegate should implement to update its views when items are pushed and popped from the stack. The navigation bar represents only the bar at the top of the screen, not the view below. It’s the application’s responsibility to implement the behavior when the top item changes.	/// </summary>	[iOSVersion(2)]	public interface UINavigationBarDelegate	{		/// <summary>		/// Returns a Boolean value indicating whether the navigation bar should push an item.		/// </summary>		/// <param name="navigationBar">The navigation bar that the item is being pushed onto.</param>		/// <param name="shouldPushItem">The navigation item that is being pushed.</param>		/// <returns>true if the item should be pushed; otherwise, false.</returns>		[iOSVersion(2)]		[Export("navigationBar")]		[Optional]		bool NavigationBar(UINavigationBar navigationBar, UINavigationItem shouldPushItem);				/// <summary>		/// Tells the delegate that an item was pushed onto the navigation bar.		/// </summary>		/// <param name="navigationBar">The navigation bar that the item is being pushed onto.</param>		/// <param name="didPushItem">The navigation item that is being pushed.</param>		[iOSVersion(2)]		[Export("navigationBar")]		[Optional]		void NavigationBar(UINavigationBar navigationBar, UINavigationItem didPushItem);				/// <summary>		/// Returns a Boolean value indicating whether the navigation bar should pop an item.		/// </summary>		/// <param name="navigationBar">The navigation bar that the item is being popped from.</param>		/// <param name="shouldPopItem">The navigation item that is being popped.</param>		/// <returns>true if the item should be popped; otherwise, false.</returns>		[iOSVersion(2)]		[Export("navigationBar")]		[Optional]		bool NavigationBar(UINavigationBar navigationBar, UINavigationItem shouldPopItem);				/// <summary>		/// Tells the delegate that an item was popped from the navigation bar.		/// </summary>		/// <param name="navigationBar">The navigation bar that the item is being popped from.</param>		/// <param name="didPopItem">The navigation item that is being popped.</param>		[iOSVersion(2)]		[Export("navigationBar")]		[Optional]		void NavigationBar(UINavigationBar navigationBar, UINavigationItem didPopItem);	}}